.text
    j       main

main:
    la      s0, LED_MATRIX_0_BASE   # matrix pointer
    la      s1, image               # image pointer
    lui     s2, 0x1000a          # image + size (end of the image)
    addi    s2, s2, -760
    li      s3, 0                   # row counter
    add t1, x0, s0

loop:
    lbu     t0, 0(s1)   # load a byte/pixel from the image
    addi s4, x0, IMG_WHITE
    addi s5, x0, IMG_BLACK
    addi s6, x0, IMG_NEWLINE
     bne t0, s4, notwhite
     li s7, COLOR_WHITE 
     sw s7, 0(t1)
     j endif
     
     notwhite:
     bne t0, s5, nextline
     li s7, COLOR_BLACK 
     sw s7, 0(t1)
     j endif
     
     nextline:
     addi s3, s3, 1
     li s9, LED_MATRIX_0_WIDTH
     slli s9, s9, 2
     add s8, x0, s9
     mul s8, s3, s8
     
     add t1, s0, s8
     j jend
     
      
    endif:    
    
    addi t1, t1, 4
 
    jend:
    addi    s1, s1, 1   # increment image pointer
    
    
    
    

    ## if the byte is a newline, move the LED pointer to the start of the next row
    # increment the row counter (s3)
    # use it to calculate the address of that row
    # update the matrix pointer (s0)
    # skip LED drawing (there's nothing to draw, the byte only encodes a new line)
    #   don't just jump to 'loop'! what if this is the last newline?

    ## if the byte is not a newline, draw a pixel on the LED matrix
    # check if the byte is IMG_WHITE or IMG_BLACK and set the color accordingly
    # write the color to the LED matrix pointer
    # increment the pointer

branch:
    blt     s1, s2, loop    # branch if we haven't reached the image end

    j       exit

exit:
    li      a7, ECALL_Exit
    ecall